import React, { useState } from 'react';
import { useHistory } from 'react-router-dom'; // useHistory ekleyin

function AdminPage() {
  const history = useHistory(); // useHistory kullanımı

  const [inputPageCount, setInputPageCount] = useState(1);
  const [outputPageCount, setOutputPageCount] = useState(1);
  const [contactPageEnabled, setContactPageEnabled] = useState(true);
  const [calculationFormulas, setCalculationFormulas] = useState({});
  const [imageUploads, setImageUploads] = useState({});

  const handleSave = () => {
    // Gerekli verileri sunucuya kaydetme işlemi burada yapılabilir.
    // Bu verileri bir veritabanında veya başka bir saklama yönteminde depolayabilirsiniz.
    // Örneğin, state'teki değerleri bir API'ye gönderebilirsiniz.
    // ...

    alert('Ayarlar kaydedildi.');
  };

  return (
    <div>
      <h1>Admin Configuration Page</h1>

      <div>
        <h2>Input and Output Pages</h2>
        <label>Number of Input Pages: </label>
        <input
          type="number"
          value={inputPageCount}
          onChange={(e) => setInputPageCount(parseInt(e.target.value))}
        />

        <label>Number of Output Pages: </label>
        <input
          type="number"
          value={outputPageCount}
          onChange={(e) => setOutputPageCount(parseInt(e.target.value))}
        />
      </div>

      {/* Diğer ayarları ve bileşenleri buraya ekleyin */}
      
      <button onClick={handleSave}>Save Settings</button>
      <button onClick={() => history.goBack()}>Back to Login</button>
    </div>
  );
}

export default AdminPage;
